import ExpenseItem from "./components/ExpenseItem";

function Expenses(props) {
  
  return (
    <div>
      <h2>Expense Items!</h2>
      {data.map((ele) => {
        return (
          <div>
            <ExpenseItem
              key={ele.id}
              title={ele.title}
              location={ele.location}
              date={ele.date}
              amount={ele.amount}
            />
          </div>
        );
      })}
    </div>
  );
}

export default Expenses;
